using System;
using System.IO;
using System.Linq;
using System.Web;
using System.Web.Mvc;
using TqCcnetDashboard;
using TqLib.Utils;

namespace TqCcnetDashboard.Controllers
{
    [Authorize]
    public class DirViewController : AbstractController
    {
        public JsonResult Search(string path = "")
        {
            var rpath_root = GetPath(string.Empty);
            var rpath = GetPath(path);
            if (!IsUserAuthFolder(rpath)) return Json();

            if (!Directory.Exists(rpath)) Directory.CreateDirectory(rpath);

            var dir = new DirectoryInfo(rpath);

            return Json(new
            {
                parent = IsUserAuthFolder(dir.Parent?.FullName) ? new PathInfo(dir.Parent, rpath_root) : null,
                name = dir.Name,
                path = GetCurrentPath(dir.FullName, rpath_root),
                subs = dir.GetDirectories().Select(t => new PathInfo(t, rpath_root)).Union(dir.GetFiles().Select(t => new PathInfo(t, rpath_root)))
            });
        }

        private string GetCurrentPath(string path, string rpath_root)
        {
            var refPath = path.Replace(rpath_root, string.Empty).Replace(@"\", "/");
            return refPath;
        }

        private string GetPath(string path)
        {
            path = path.Replace(@"\", "/");
            if (path.StartsWith("/")) path = path.Substring(1);
            return Server.MapPath(PathUtil.Combine(CurrentUser.WorkingDirectory, path));
        }

        private bool IsUserAuthFolder(string path)
        {
            if (string.IsNullOrEmpty(path)) return false;
            var src = GetPath("");
            return path.StartsWith(src, StringComparison.OrdinalIgnoreCase);
        }

        protected class PathInfo
        {
            public string name { get; set; }
            public string path { get; set; }
            public string mime { get; set; }
            public string icon { get; set; }

            public PathInfo(FileInfo file, string rpath_root)
            {
                name = file.Name;
                path = file.FullName.Replace(rpath_root, string.Empty).Replace(@"\", "/");
                mime = MimeMapping.GetMimeMapping(file.FullName);

                if (name.EndsWith(".sln", StringComparison.OrdinalIgnoreCase))
                {
                    icon = "/Content/img/IconSolution.png";
                }
                else
                {
                    var ic = System.Drawing.Icon.ExtractAssociatedIcon(file.FullName);
                    using (MemoryStream ms = new MemoryStream())
                    {
                        ic.Save(ms);
                        icon = "data:image/x-icon;base64," + Convert.ToBase64String(ms.ToArray());
                    }
                }
            }

            public PathInfo(DirectoryInfo file, string rpath_root)
            {
                name = file.Name;
                path = file.FullName.Replace(rpath_root, string.Empty).Replace(@"\", "/");
                mime = "DIRECTORY";
                icon = "data:image/x-icon;base64,";
            }
        }
    }
}